script: |
  super -f text -I q12909.spq | sort > q12909.out

inputs:
  - name: q12909.spq
    data: |
      SELECT - - col0 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE + col1 NOT BETWEEN NULL AND - + col1 * - - col0 + - col2;
  - name: tab0

outputs:
  - name: q12909.out
    data: |
      15
      87
      97
